import "./productList.css";

const ProductList = () => {
  return (
    <div className="pl">
      <div className="pl-texts">
        <h1 className="pl-title">Create & Inspire. It's Lama</h1>
        <p className="pl-desc"></p>
      </div>
      <div className="pl-list">{/* <Product /> */}</div>
    </div>
  );
};

export default ProductList;
